                    break;
                default:
                    return ResponseError<object>("没有找到对应业务类型");
                    break;
            }
        }

        [Route("initdicdata")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> InitDicData([FromBody] SynSapModel model = null)
        {
            _baseDataServices.InitDicDataQrtz();
            return new OutputResult<object>(null);
        }

        [Route("fetchcustdata")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> FetchCustData([FromBody] SynSapModel model = null)
        {
            if (model == null || model.RecIds.Count == 0)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP客户数据", string.Empty);

            var sendResult = _fetchCustomerServices.FetchCustData(model, UserId, 1);
            return new OutputResult<object>(sendResult);
        }
        [Route("getcustcreditlimit")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> getCustomerCreditLimit([FromBody] CustomerCreditLimitParam model = null)
        {
            if (model == null)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP客户信用额度", string.Empty);

            var sendResult = _fetchCustomerServices.getCustomerCreditLimit(model, 1);
            return (sendResult);
        }
        [Route("getcustomerreceivable")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> getCustomerReceivable([FromBody] CustomerReceivableParam model = null)
        {
            if (model == null)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP客户应收账款", string.Empty);

            var sendResult = _fetchCustomerServices.getCustomerReceivable(model, 1);
            return (sendResult);
        }
        [Route("getorders")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> getOrders([FromBody] SoOrderParamModel model = null)
        {
            if (model == null)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP订单列表", string.Empty);

            var sendResult = _orderServices.getOrders(model, 1);
            return (sendResult);
        }
        [Route("fetchcustdatabyid")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> FetchCustDataById([FromBody] SynSapModel model = null)
        {
            if (model == null || model.RecIds.Count == 0)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP客户数据根据id", string.Empty);
            var c = _fetchCustomerServices.FetchCustData(model, UserId, 3);

            if (c.Flag == 1)
            {
                return new OutputResult<object>(c.Msg);
            }
            else
            {
                return ResponseError<object>(c.Msg);
            }
        }

        [Route("fetchorderdatabyid")]
        [HttpPost]
        [AllowAnonymous]
        public OutputResult<object> FetchOrderDataById([FromBody] SoOrderParamModel model = null)
        {
            if (model == null)
                return ResponseError<object>("参数格式错误");
            WriteOperateLog("获取SAP订单数据根据id", string.Empty);
            var c = _orderServices.getOrders(model);

            if (c.Status == 0)
            {
                return new OutputResult<object>(c.Message);
            }
            else
            {
                return ResponseError<object>(c.Message);
            }
        }

